import React, { useState } from 'react';

const CalendarView = ({ citas = [], pacientes = [], onAddAppointment = () => {}, onEditAppointment = () => {} }) => {
  const [currentDate, setCurrentDate] = useState(new Date());
  const [viewMode, setViewMode] = useState('diaria'); // diaria, semanal, mensual
  const [selectedAppointment, setSelectedAppointment] = useState(null);
  const [showAppointmentModal, setShowAppointmentModal] = useState(false);
  const [newAppointment, setNewAppointment] = useState({
    fecha: new Date().toISOString().split('T')[0],
    hora: '09:00',
    pacienteId: '',
    motivo: '',
    estado: 'pendiente'
  });

  const handleViewChange = (mode) => setViewMode(mode);

  const startOfWeek = (date) => {
    const d = new Date(date);
    d.setDate(d.getDate() - d.getDay());
    return d;
  };

  const getDatesInRange = (mode) => {
    const dates = [];
    if (mode === 'diaria') return [currentDate];
    if (mode === 'semanal') {
      const start = startOfWeek(currentDate);
      for (let i = 0; i < 7; i++) {
        const next = new Date(start);
        next.setDate(start.getDate() + i);
        dates.push(next);
      }
    } else if (mode === 'mensual') {
      const year = currentDate.getFullYear();
      const month = currentDate.getMonth();
      const daysInMonth = new Date(year, month + 1, 0).getDate();
      for (let i = 1; i <= daysInMonth; i++) {
        dates.push(new Date(year, month, i));
      }
    }
    return dates;
  };

  const getPacienteNombre = (id) => {
    const paciente = pacientes.find(p => p._id === id);
    return paciente ? `${paciente.nombre} ${paciente.apellido}` : 'Paciente no encontrado';
  };

  const groupedCitas = {};
  getDatesInRange(viewMode).forEach(date => {
    const dateStr = date.toISOString().split('T')[0];
    groupedCitas[dateStr] = citas.filter(c => c.fecha === dateStr);
  });

  return (
    <div className="bg-white rounded-xl shadow-sm p-6">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-semibold text-indigo-800">Calendario de Citas</h2>
        <div className="space-x-2">
          <button className="text-sm bg-indigo-100 px-3 py-1 rounded" onClick={() => handleViewChange('diaria')}>DÃ­a</button>
          <button className="text-sm bg-indigo-100 px-3 py-1 rounded" onClick={() => handleViewChange('semanal')}>Semana</button>
          <button className="text-sm bg-indigo-100 px-3 py-1 rounded" onClick={() => handleViewChange('mensual')}>Mes</button>
        </div>
      </div>

      {Object.keys(groupedCitas).map(date => (
        <div key={date} className="mb-4">
          <h3 className="text-md font-medium text-indigo-700 mb-2">{new Date(date).toLocaleDateString('es-ES', { weekday: 'long', day: 'numeric', month: 'long' })}</h3>
          {groupedCitas[date].length > 0 ? (
            <div className="space-y-2">
              {groupedCitas[date].map(cita => (
                <div key={cita._id} className="p-3 border rounded-lg bg-indigo-50">
                  <div className="flex justify-between items-center">
                    <div>
                      <p className="font-semibold">{getPacienteNombre(cita.pacienteId)}</p>
                      <p className="text-sm">{cita.motivo}</p>
                    </div>
                    <div className="text-right">
                      <p className="text-sm">{cita.hora}</p>
                      <span className={`text-xs px-2 py-1 rounded-full ${
                        cita.estado === 'completada' ? 'bg-green-100 text-green-800' :
                        cita.estado === 'cancelada' ? 'bg-red-100 text-red-800' :
                        'bg-yellow-100 text-yellow-800'
                      }`}>
                        {cita.estado}
                      </span>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-gray-500">No hay citas</p>
          )}
        </div>
      ))}
    </div>
  );
};

export default CalendarView;
